class ViewController: UIViewController, WebSocketDelegate {
    
    var type = 0
    
    var socket: WebSocket!
    var isConnected = false
    let sever = WebSocketServer()
    var lastUpdateId: Int = 0
    var U: Int = 0
    var u: Int = 0
    
    var bids: Array<Array<String>>!
    var asks: Array<Array<String>>!
    
    var trades: Array<Dictionary<String, Any>>!
    
    override func viewDidLoad() {
        super.viewDidLoad()
        self.navigationItem.leftBarButtonItem = UIBarButtonItem(title: "Order", style: .plain, target: self, action: #selector(orderClick))
        self.navigationItem.rightBarButtonItem = UIBarButtonItem(title: "Market", style: .plain, target: self, action: #selector(marketClick))
        
        tableView.register(UINib(nibName: "OrderBookCell", bundle: nil), forCellReuseIdentifier: "ordercell")
        tableView.register(UINib(nibName: "MarketHistoryCell", bundle: nil), forCellReuseIdentifier: "marketcell")
        
        snapShotInit()
        tradesInit()
        socketInit()
        subviewsInit()
    }
    
    override func viewWillLayoutSubviews() {
        super.viewWillLayoutSubviews()
        tableView.frame = view.bounds
    }
    
    @objc private func orderClick() {
        type = 0
        tableView.reloadData()
    }
    
    @objc private func marketClick() {
        type = 1
        tableView.reloadData()
    }
    
    private func snapShotInit() {
        let jsonData: Data = depthSnapShot.data(using: .utf8)!
        let dict = try? JSONSerialization.jsonObject(with: jsonData, options: .mutableContainers)
        if dict != nil {
            let s_dict = dict as! Dictionary<String, Any>
            lastUpdateId = (s_dict["lastUpdateId"] as? Int) ?? 0
            bids = (s_dict["bids"] as! Array<Array<String>>)
            asks = (s_dict["asks"] as! Array<Array<String>>)
            
            print("bids.count = ", bids.count, "asks.count = ", asks.count)
        }
    }
    
    private func tradesInit() {
        let jsonData: Data = trade.data(using: .utf8)!
        let dict = try? JSONSerialization.jsonObject(with: jsonData, options: .mutableContainers)
        if dict != nil {
            trades = dict as! Array<Dictionary<String, Any>>
        }
    }
    
    private func socketInit() {
       var request = URLRequest(url: URL(string: "wss://stream.binance.com:9443/ws/bnbbtc@depth")!)
        request.timeoutInterval = 5
        socket = WebSocket(request: request)
        socket.delegate = self
        socket.connect()
    }
    
    private func subviewsInit() {
        view.addSubview(tableView)
    }
    
    lazy var tableView: UITableView = {
        let tv = UITableView(frame: CGRect.zero)
        tv.dataSource = self
        return tv
    }()
}

extension ViewController: UITableViewDataSource {
    func tableView(_ tableView: UITableView, numberOfRowsInSection section: Int) -> Int {
        if type == 1 {
            return trades.count
        }
        return min(bids.count, asks.count)
    }
    
    func tableView(_ tableView: UITableView, cellForRowAt indexPath: IndexPath) -> UITableViewCell {
        
        if type == 1 {
            let market_cell = tableView.dequeueReusableCell(withIdentifier: "marketcell") as! MarketHistoryCell
            market_cell.data = trades[indexPath.row]
            return market_cell
        }
        
        let cell = tableView.dequeueReusableCell(withIdentifier: "ordercell") as! OrderBookCell
        cell.data = (bids[indexPath.row], asks[indexPath.row])
        return cell
    }
    
    
}

extension ViewController {
    func didReceive(event: WebSocketEvent, client: WebSocket) {
        switch event {
        case .connected(let headers):
            isConnected = true
            print("websocket is connected: \(headers)")
        case .disconnected(let reason, let code):
            isConnected = false
            print("websocket is disconnect: \(reason) with code: \(code)")
        case .text(let string):
            print("receive text: \(string)")
            handText(string)
        case .binary(let data):
            print("receive data: \(data.count)")
        case .ping(_):
            break
        case .pong(_):
            break
        case .viablityChanged(_):
            break
        case .reconnectSuggested(_):
            break
        case .cancelled:
            isConnected = false
        case .error(let error):
            isConnected = false
            handleError(error)
        }
    }
    
    func handleError(_ error: Error?) {
        if let e = error as? WSError {
            print("websocket encountered an error: \(e.message)")
        } else if let e = error {
            print("websocket encountered an error: \(e.localizedDescription)")
        } else {
            print("websocket encountered an error")
        }
    }
    
    func handText(_ text: String) {
        
        let jsonData: Data = text.data(using: .utf8)!
        let dict = try? JSONSerialization.jsonObject(with: jsonData, options: .mutableContainers)
        if dict == nil { return }
        let s_dict = dict as! Dictionary<String, Any>
        let u = (s_dict["u"] as? Int) ?? 0
        let U = (s_dict["U"] as? Int) ?? 0
        self.U = U
        self.u = u
        if u <= lastUpdateId { return }
        if U <= lastUpdateId + 1, u >= lastUpdateId + 1 {
            let bb = s_dict["b"] as? Array<Array<String>>
            let aa = s_dict["a"] as? Array<Array<String>>
            if let bb = bb {
                for s_bb in bb {
                    if  let d = Double(s_bb[1]), d == 0 {
                        let p = s_bb[0]
                        for (index, s_bids) in bids.enumerated() {
                            if p == s_bids[0]{
                                bids.removeFirst(index)
                            }
                        }
                    }
                }
            }
            if let aa = aa {
                for s_aa in aa {
                    if  let d = Double(s_aa[1]), d == 0 {
                        let p = s_aa[0]
                        for (index, s_asks) in asks.enumerated() {
                            if p == s_asks[0]{
                                asks.removeFirst(index)
                            }
                        }
                    }
                }
            }
            
            tableView.reloadData()
        }
    }
}

